function subNavMarker(){Array.from(document.querySelectorAll(".primary-subnav-link, .secondary-subnav-link")).filter(e=>e.getAttribute("href").includes(location.pathname)).forEach(e=>{e.classList.add("active-link"),e.setAttribute("href","")}),Array.from(document.querySelectorAll(".active-link")).filter(e=>!e.classList.contains("primary-subnav-link")).forEach(e=>e.parentNode.parentNode.parentNode.classList.add("active-parent"))}document.addEventListener("DOMContentLoaded",function(){subNavMarker()});